import { Link } from "react-router-dom";

export const Navbar = () => {
  return (
    <nav className="fixed left-0 top-16 h-full w-60 border-r border-black flex flex-col justify-start pt-4"> {/* 텍스트를 상단에 위치시키기 위해 pt-4 추가 */}
      <div className="flex flex-col gap-8 items-center">
        <Link to="/" className="text-black hover:text-blue-500">Home</Link>
        <Link to="/login" className="text-black hover:text-blue-500">Login</Link>
        <Link to="/signup" className="text-black hover:text-blue-500">Signup</Link>
      </div>
    </nav>
  );
};
